export class Goal {
    constructor(name, id, status, colorId){
        this.name = name;
        this.id = id;
        this.status = status;
        this.colorId = colorId;
    }
}

export function readGoals(project){
    return project.goals ? project.goals.map((goal, id) => {
        var colorId = goal.colorId && (project.goalColors.find(color => color.color === project.goalColors[goal.colorId].color)) ? goal.colorId : 0;
        console.log(goal);
        return (new Goal(goal.name, id, goal.status, colorId));
    }) : [];
}
